import React from "react";

import web from "../src/images/web1.jpg";
import app from "../src/images/web2.jpeg";
import software from "../src/images/web3.jpg";
import digital from "../src/images/web4.png";
import android from "../src/images/web5.png";
import marketing from "../src/images/web6.jpg";

const Sdata = [
  {
    imgsrc: web,
    title: "Web Development",
  },
  {
    imgsrc: app,
    title: "App Development",
  },
  {
    imgsrc: software,
    title: "Software Development",
  },
  {
    imgsrc: digital,
    title: "Digital Marketing",
  },
  {
    imgsrc: android,
    title: "Android Development",
  },
  {
    imgsrc: marketing,
    title: "Marketing",
  },
];

export default Sdata;
